    public class BulkComponentsHandler : EcosystemHandler
    {
        public override IEnumerable<Type> SubscribesTo => BulkComponents.Motherlode.Select(x => x.Key);

        public void Handle(IEnumerable<Entity> entities)
        {
            this.Called++;
            this.EntitiesHandled = entities;
        }

        public int Called;

        public IEnumerable<Entity> EntitiesHandled;
    }

    internal class BulkComponents
    {
        public static IReadOnlyDictionary<Type, Component> Motherlode => _motherlode ?? (_motherlode = GetMotherlode());
        private static Dictionary<Type, Component> _motherlode;

        private static Dictionary<Type, Component> GetMotherlode()
        {
            var list = new Dictionary<Type, Component>();
            foreach (var type in typeof(BulkComponents).GetNestedTypes())
            {
                var instance = Activator.CreateInstance(type) as Component;
                list.Add(type, instance);
            }
            return list;
        }

